import React from 'react';
import { Provider } from 'react-redux';
import store from './Store';
import AddUserForm from './components/AddUserForm';

const App = () => {
  return (
    <Provider store={store}>
      <UserList />
      <AddUserForm />
    </Provider>
  );
};

export default App;
